# example GPS measurement
splitString = gpsString.split("$")

#helper function to find the nth instance of a substring
def find_nth(s, substring, n):
    start = s.find(substring)
    while start >= 0 and n > 1:
        start = s.find(substring, start+len(substring))
        n -= 1
    return start

#selecting only for valid GPS measurements, (indicated by GNRMC)
GNRMCStrings = []
for string in splitString:
    if "GNRMC" in string:
        GNRMCStrings.append(string)

# print(GNRMCStrings)

#exampleString = GNRMC,204017.00,A,4226.76260,N,07628.80845,W,0.567,,061121,,,A*70
#splitting up string to get specific lattitude hemisphere,degrees, and minutes
exampleString = GNRMCStrings[0]
latHemisphere = exampleString[find_nth(exampleString,",",4) + 1:find_nth(exampleString,",",5)]
latDegrees = int(exampleString[find_nth(exampleString,",",3) + 1:find_nth(exampleString,".",2)-2])
latMinutes = float(exampleString[find_nth(exampleString,".",2) - 2:find_nth(exampleString,",",4)])
print(latDegrees, latMinutes, latHemisphere)
#splitting up string to get specific longitude hemisphere,degrees, and minutes
longHemisphere = exampleString[find_nth(exampleString,",",6) + 1:find_nth(exampleString,",",7)]
longDegrees = int(exampleString[find_nth(exampleString,",", 5) + 1:find_nth(exampleString,".",3)-2])
longMinutes = float(exampleString[find_nth(exampleString,".",3) - 2:find_nth(exampleString,",",6)])
print(longDegrees, longMinutes, longHemisphere)
